const item = items[0].json;

function formatObject(obj, indent = '') {
  let output = '';
  for (const key in obj) {
    if (Array.isArray(obj[key])) {
      output += `\n${indent}üîÅ ${key.charAt(0).toUpperCase() + key.slice(1)}:\n`;
      obj[key].forEach((entry, idx) => {
        output += `${indent}  ${idx + 1}.\n`;
        output += formatObject(entry, indent + '    ');
      });
    } else if (typeof obj[key] === 'object' && obj[key] !== null) {
      output += `\n${indent}${key}:\n`;
      output += formatObject(obj[key], indent + '  ');
    } else {
      output += `${indent}- ${key}: ${obj[key] ?? 'N/A'}\n`;
    }
  }
  return output;
}

const formattedText = formatObject(item);

return [
  {
    json: {
      formattedText
    }
  }
];

